/**
 * `compatto`'s standard dictionary.
 * Even if it is the standard one it must be explicitly set by the user.
 *
 * @example
 *  import { dictionary } from 'compatto/dictionary'
 *  import { compatto } from 'compatto'
 *
 *  compatto({ dictionary })
 *  => { compress, decompress }
 */
export const dictionary: string[]
